        this.rightPane = rightPane;
        this.ul = document.createElement('ul');
        this.element.appendChild(this.ul);
        this.params = this.getAllParams(objects.Mibx.Module.Node);
        this.dependenciesDictionary = _.chain(this.params).pluckMany('UID', 'Dependencies').groupBy(function (o) {
            if (o !== undefined && o.Dependencies !== undefined && o.Dependencies.InactiveDependency !== undefined) {
                return o.Dependencies.InactiveDependency.Condition.ClauseGroup.Clause.ClauseLeft.UID;
            }
        }).value();
        console.log(nodes);
        self.tableDictionary = new Array();
        this.generateNodes(this.ul, this.rightPane, nodes.Guix.Configuration.GuixNode);
