            //<a href="#" onclick= "onHello();return false;" > <label style="cursor:pointer" > Hello2 < /label></a >
            var link = document.createElement('a');
            link.href = '#' + value.UID;
            var label = document.createElement('label');
            //label.htmlFor = value.UID;
            label.innerHTML = value.Name;
            link.appendChild(label);
            var li = document.createElement('li');
            var divLi = document.createElement('div');
            if (value.GuixNode !== null && value.GuixNode !== undefined && value.GuixNode.length > 0) {
                divLi.appendChild(checkBox);
            }
            divLi.appendChild(link);
            el.appendChild(divLi);
            console.log(value);
            var divSection = document.createElement('section');
            divSection.id = value.UID;
            divSection.className = 'page';
            //var params = self.getAllParams(objects.Mibx.Module.Node);
            if (value.GuixSection instanceof Array) {
                var sections = value.GuixSection;
                if (sections !== null && sections !== undefined && sections.length > 0) {
                    sections.forEach(function (value) {
                        self.generateSection(divSection, value);
                    });
                }
            }
            else {
                //var guixSection = <guixEntities.GuixSection>value.GuixSection;
                var input = value.GuixSection !== undefined ? value.GuixSection : value.GuixNode;
                self.generateSection(divSection, input);
            }
